import React, { useState } from 'react';
import { useEffect } from 'react';
import Paper from '@mui/material/Paper';
import { useParams } from 'react-router-dom';
import { Typography } from '@mui/material';
import { styled } from '@mui/system';
import { Link } from 'react-router-dom';
import { Document, Page, pdfjs } from 'react-pdf';

const Edit = () => {

    const menuId = useParams();
    const [departmentName, setDepartmentName] = useState('');
    const [functionName, setFunctionName] = useState('');
    const [applicationName, setApplicationName] = useState('');
    const [author, setAuthor] = useState('');
    const [description, setDescription] = useState('');
    const [filesToAdd, setFilesToAdd] = useState([]);
    const [fileIdsToDelete, setFileIdsToDelete] = useState([]);

    const handleFileChange = (event) => {
        setFilesToAdd([...event.target.files]);
    };

    const handleDeleteFile = (fileId) => {
        setFileIdsToDelete((prevFileIds) => [...prevFileIds, fileId]);
    };

    const handleSubmit = async (event) => {
        event.preventDefault();

        const formData = new FormData();
        formData.append('departmentName', departmentName);
        formData.append('functionName', functionName);
        formData.append('applicationName', applicationName);
        formData.append('author', author);
        formData.append('description', description);

        for (let i = 0; i < filesToAdd.length; i++) {
            formData.append('filesToAdd', filesToAdd[i]);
        }

        try {
            const response = await fetch(`http://localhost:8080/update/${menuId}`, {
                method: 'POST',
                body: formData,
            });

            if (response.ok) {
                // Reset form fields
                setDepartmentName('');
                setFunctionName('');
                setApplicationName('');
                setAuthor('');
                setDescription('');
                setFilesToAdd([]);
                setFileIdsToDelete([]);

                // Display success message or navigate to another page
            } else {
                throw new Error('Error updating menu');
            }
        } catch (error) {
            // Handle the error
            console.error('Error updating menu:', error);
        }
    };

    return (
        <div>
            <h1>Edit Menu</h1>
            <form onSubmit={handleSubmit}>
                <div>
                    <label>Department Name:</label>
                    <input
                        type="text"
                        value={departmentName}
                        onChange={(event) => setDepartmentName(event.target.value)}
                    />
                </div>
                <div>
                    <label>Function Name:</label>
                    <input
                        type="text"
                        value={functionName}
                        onChange={(event) => setFunctionName(event.target.value)}
                    />
                </div>
                <div>
                    <label>Application Name:</label>
                    <input
                        type="text"
                        value={applicationName}
                        onChange={(event) => setApplicationName(event.target.value)}
                    />
                </div>
                <div>
                    <label>Author:</label>
                    <input
                        type="text"
                        value={author}
                        onChange={(event) => setAuthor(event.target.value)}
                    />
                </div>
                <div>
                    <label>Description:</label>
                    <input
                        type="text"
                        value={description}
                        onChange={(event) => setDescription(event.target.value)}
                    />
                </div>
                <div>
                    <label>Files to Add:</label>
                    <input type="file" multiple onChange={handleFileChange} />
                </div>
                <div>
                    <label>Files to Delete:</label>
                    {fileIdsToDelete.map((fileId) => (
                        <div key={fileId}>
                            <span>{fileId}</span>
                            <button type="button" onClick={() => handleDeleteFile(fileId)}>
                                Delete
                            </button>
                        </div>
                    ))}
                </div>
                <button type="submit">Update Menu</button>
            </form>
        </div>
    );
};

export default Edit;
